-   comments: '# Stubs so that the client driver can build alone since our deps are
        screwed up. We have symbols# that are required by shared code that are very
        internal to the server, so if we didn''t have these# files we''d either need
        to include the whole server (which we want to avoid) or the build wouldn''t#
        successfully link.'
    files:
    - src/mongo/client/clientAndShell.cpp
    - src/mongo/client/clientOnly-private.h
    - src/mongo/client/clientOnly.cpp
-   comments: '# Stubs to initialize the client driver when it is used standalone.
        Calls MONGO_INITIALIZERs among# other things. Not built into the server.'
    files:
    - src/mongo/client/init.cpp
    - src/mongo/client/init.h
-   comments: '# The Core C++ Client Driver Library## who uses these, and why? maybe
        this description should be broken up into## some components, e.g. what exactly
        is a ''dbclient'', a ''dbclientcursor''## and a ''syncclusterconnection''
        ?'
